insert into movie (movie_id, name, genre, description , content_rating, release_date) values ('M00001', 'Knife in the Water', 'Drama', 'A hobbit named Frodo embarks on a perilous journey to destroy an ancient ring that could enslave the world accompanied by a fellowship of warriors and wizards or other creatures.', '18', '1-Jan-2014');
insert into movie (movie_id, name, genre, description , content_rating, release_date) values ('M00002', 'Andre', 'Adventure|Children|Drama', 'A group of rebels fight against a tyrannical government in a post-apocalyptic world.', 'U', '3-Jan-2014');
insert into movie (movie_id, name, genre, description , content_rating, release_date) values ('M00003', 'Tokyo Trial (Tokyo saiban)', 'Documentary', 'A young boy befriends a friendly alien but must protect him from the government agents who seek to capture him.', '18', '4-Jan-2014');
insert into movie (movie_id, name, genre, description , content_rating, release_date) values ('M00004', 'Casanova 70', 'Comedy|Drama', 'A group of scientists visit a theme park filled with cloned dinosaurs --only to face a catastrophic failure in the security system that puts their lives in danger.', 'U', '11-Jan-2014');
insert into movie (movie_id, name, genre, description , content_rating, release_date) values ('M00005', 'Acacia', 'Horror|Mystery', 'A story about a group of programmer targeting his former colleagues.', '18', '12-Jan-2014');
insert into movie (movie_id, name, genre, description , content_rating, release_date) values ('M00006', 'Last of the Unjust', 'Documentary', 'A computer programmer discovers that the world he lives in is a simulated reality and joins a group of rebels in their fight against the machines that control it.', '18', '12-Jan-2014');
insert into movie (movie_id, name, genre, description , content_rating, release_date) values ('M00007', 'Darkness', 'Horror|Mystery', 'Adventurer Indiana Jones goes on a quest to find the legendary Ark of the Covenant before it falls into the wrong hands.', '18', '21-Jan-2014');
insert into movie (movie_id, name, genre, description , content_rating, release_date) values ('M00008', 'Adventures of Ford Fairlane', 'Action|Comedy', 'A young cop goes undercover to infiltrate a Boston crime syndicate while a member of the syndicate becomes an informant for the police.', '13', '22-Jan-2014');
insert into movie (movie_id, name, genre, description , content_rating, release_date) values ('M00009', 'Jazz Singer', 'Musical', 'A man is falsely convicted of murder and sent to prison where he forms a friendship with another inmate', '18', '3-Feb-2014');
insert into movie (movie_id, name, genre, description , content_rating, release_date) values ('M00010', 'Childs Pose', 'Drama', 'A small beach town is terrorized by a giant man-eating shark -- as the local police chief (a marine biologist) and a shark hunter team up to stop it.', '18', '3-Feb-2014');
insert into movie (movie_id, name, genre, description , content_rating, release_date) values ('M00011', 'The Godfather', 'Horror|Mystery', 'A news report is shown that the assailants were Annabelle Higgins and her boyfriend. They murdered her parents and are said to have been part of a demonic cult. ', '18', '3-Feb-2014');
insert into movie (movie_id, name, genre, description , content_rating, release_date) values ('M00012', 'Forrest Gump', 'Comedy|Drama', 'A young cop goes undercover to infiltrate a Boston crime syndicate while a member of the syndicate becomes an informant for the police.', '13', '10-Feb-2014');
insert into movie (movie_id, name, genre, description , content_rating, release_date) values ('M00013', 'The Dark Knight', 'Horror|Mystery', 'A non-linear narrative follows the intertwined lives of various characters -- including two hitmen and a boxer plus a gangsters wife.', '18', '15-Feb-2014');
insert into movie (movie_id, name, genre, description , content_rating, release_date) values ('M00014', 'Schindlers List', 'Horror|Mystery', 'To maintain low crime and unemployment rates throughout the year -- the government has instituted an annual 12-hour period called The Purge during which all criminal activity (including murder- theft- rape- etc.)', '18', '3-Mar-2014');
insert into movie (movie_id, name, genre, description , content_rating, release_date) values ('M00015', 'Pulp Fiction', 'Documentary', 'The story of the founding of Facebook and the ensuing legal battles as told through the perspectives of its co-founders and their various allies.', '13', '4-Mar-2014');
insert into movie (movie_id, name, genre, description , content_rating, release_date) values ('M00016', 'The Shawshank Redemption', 'Horror|Mystery', 'A group of criminals are brought together for a heist but everything goes wrong when they are pursued by a mysterious mastermind. ', '18', '11-Mar-2014');
insert into movie (movie_id, name, genre, description , content_rating, release_date) values ('M00017', 'Titanic', 'Drama', 'A poor artist falls in love with a wealthy woman aboard the doomed Titanic, as they struggle to survive the sinking ship.', '13', '15-Mar-2014');
insert into movie (movie_id, name, genre, description , content_rating, release_date) values ('M00018', 'Star Wars: A New Hope', 'Adventure|Children|Drama', 'A space opera set - a long time ago in a galaxy far away-- the film centres on Luke Skywalker (played by the then relatively unknown Mark Hamill) -- a young man who finds himself embroiled in an interplanetary war between an authoritarian empire and rebel forces.', 'U', '16-Mar-2014');
insert into movie (movie_id, name, genre, description , content_rating, release_date) values ('M00019', 'The Matrix', 'Action|Comedy', 'A German businessman saves the lives of hundreds of Jewish refugees during the Holocaust by employing them in his factory.', 'U', '20-Mar-2014');
insert into movie (movie_id, name, genre, description , content_rating, release_date) values ('M00020', 'Goodfellas', 'Documentary', 'A simple-minded man experiences various historic events throughout his life while searching for the love of his life.', '13', '25-Mar-2014');
